    :host,
    :root {
      --fa-font-regular: normal 400 1em/1 "Font Awesome 6 Free"
    }

    @font-face {
      font-family: "Font Awesome 6 Free";
      font-style: normal;
      font-weight: 400;
      /*savepage-font-display=block*/
      src:
        /*savepage-url=../webfonts/fa-regular-400.woff2*/
        url() format("woff2"),
        /*savepage-url=../webfonts/fa-regular-400.ttf*/
        url() format("truetype")
    }

    .fa-regular,
    .far {
      font-family: "Font Awesome 6 Free";
      font-weight: 400
    }

    :host,
    :root {
      --fa-font-solid: normal 900 1em/1 "Font Awesome 6 Free"
    }



    .fa-solid,
    .fas {
      font-family: "Font Awesome 6 Free";
      font-weight: 900
    }

    @font-face {
      font-family: "Font Awesome 5 Brands";
      /*savepage-font-display=block*/
      font-weight: 400;
      src:
        /*savepage-url=../webfonts/fa-brands-400.woff2*/
        url() format("woff2"),
        /*savepage-url=../webfonts/fa-brands-400.ttf*/
        url() format("truetype")
    }



    @font-face {
      font-family: "Font Awesome 5 Free";
      /*savepage-font-display=block*/
      font-weight: 400;
      src:
        /*savepage-url=../webfonts/fa-regular-400.woff2*/
        url() format("woff2"),
        /*savepage-url=../webfonts/fa-regular-400.ttf*/
        url() format("truetype")
    }



    ::-webkit-scrollbar {
      width: auto;
      height: 5px;
    }

    ::-webkit-scrollbar-track {
      background-color: auto;
      -webkit-border-radius: auto;
      border-radius: auto;
    }

    ::-webkit-scrollbar-thumb {
      -webkit-border-radius: auto;
      border-radius: auto;
      background: #c1c1c1;
    }

    .event-names .hyper-text:hover {
      cursor: pointer;
      text-decoration: underline;
    }

    .searchM typeahead-container {
      transform: translate3d(0px, 30px, 0px) !important;
    }

    .searchbar typeahead-container button.dropdown-item,
    .searchM typeahead-container button.dropdown-item {
      border-bottom: 1px solid #ddd !important;
    }

    .searchM typeahead-container button.dropdown-item.active,
    .searchM typeahead-container button.dropdown-item:hover,
    .searchbar typeahead-container button.dropdown-item.active,
    .searchbar typeahead-container button.dropdown-item:hover {
      background: #00678e !important;
      color: #fff !important;
    }

    .searchM typeahead-container button.dropdown-item.active .searchAnchor,
    .searchM typeahead-container button.dropdown-item:hover .searchAnchor,
    .searchbar typeahead-container button.dropdown-item.active .searchAnchor,
    .searchbar typeahead-container button.dropdown-item:hover .searchAnchor {
      color: #fff !important;
    }

    .searchM typeahead-container button.dropdown-item .searchAnchor,
    .searchbar typeahead-container button.dropdown-item .searchAnchor {
      color: #000 !important;
    }

    body {
      font-family: "Roboto Condensed", sans-serif !important;
      color: #272829;
    }

    h1,
    h2,
    h3,
    h4,
    h5,
    h6 {
      font-family: "Roboto Condensed", sans-serif !important;
    }

    a {
      text-decoration: none !important;
    }

    .btn {
      border: none !important;
    }

    .arrow-up {
      position: absolute;
      top: -3px;
      right: 2px;
      text-align: center;
    }

    .arrow-down {
      position: absolute;
      bottom: -4px;
      right: 2px;
      text-align: center;
    }

    .arrow-down i,
    .arrow-up i {
      padding: 0 5px;
      color: #000;
      background: #efefef;
      font-size: 12px;
    }

    .scorecard,
    .widgets {
      color: #fff;
      font-size: 13px;
      padding: 7px;
    }

    .scorecard svg,
    .widgets svg {
      filter: invert(1);
    }

    .banner.scorecard-banner {
      background-position: center !important;
      background:
        /*savepage-url=/assets/img/scorecard-bg.png*/
        url() !important;
      background-size: cover !important;
    }

    .rules-page {
      margin: 10px 0;
    }

    .ruser-title {
      border-radius: 0;
      margin: 10px 0;
      font-size: 1.5rem;
      background: #0088cc;
      color: var(--heading-text-color);
      text-transform: capitalize;
      padding: 0.4rem 1.25rem;
      font-weight: 500;
      align-items: center;
      display: flex;
    }

    .rules-page .rules-description {
      padding: 0;
    }

    .rules-page ul li a,
    .rules-page ul li a:hover {
      background: var(--primary) !important;
      border-radius: 0 !important;
      border-bottom: 2px solid #ddd !important;
      color: #fff;
    }

    .rules-page ul {
      width: 20%;
    }

    .rules-page .tab-content {
      width: 80%;
    }

    .rules-page .card-title {
      padding: 6px 10px;
      color: var(--heading-text-color);
      background: #2c3e50;
    }

    /*--------------------------------------------------------------
# Back to top button
--------------------------------------------------------------*/
    .th-color {
      background: #00678e !important;
    }

    .thd-color {
      background: #464646 !important;
    }

    /*topbar*/
    .topbar {
      z-index: 9999;
      height: 75px;
      top: 0;
      right: 0;
      left: 0;
      transition: background 0.3s ease-in-out;
      display: flex;
      justify-content: space-between;
      padding: 7px 0;
      background-color: #0088cc;
    }

    .logo {
      width: auto;
      height: 55px;
    }

    a.homelogo i {
      display: none;
    }

    #marquee_text {
      align-items: center;
      justify-content: center;
      float: left;
      color: #fff;
      font-size: 14px;
      font-style: italic;
    }

    .top-right {
      float: right;
      display: inline-block;
      margin-bottom: 0;
      /* margin-top: 7px; */
    }

    .top-right li {
      display: inline-block;
      margin-right: 20px;
      vertical-align: middle;
    }

    .top-right li:last-child {
      margin-right: 0;
    }

    .searchbar input,
    .searchbar input:focus {
      height: 38px;
      border: 0;
      outline: 0;
      border-radius: 0;
      box-shadow: 0 0 5px #000;
      transition: width 0.4s linear;
      width: 300px;
      padding: 0 10px;
      display: none;
    }

    .searchbar a,
    .searchbar a:hover {
      color: #fff;
    }

    .searchbar a i {
      font-size: 24px;
      margin-left: 10px;
    }

    .rules-apk a:hover {
      color: #fff !important;
    }

    .rules-apk a {
      display: block;
      color: #fff;
      font-size: 16px;
      font-weight: 600;
      cursor: pointer;
      line-height: 1;
    }

    .bespan span i.fa.fa-landmark {
      display: none;
    }

    .bespan span sub {
      font-size: 16px;
      bottom: inherit;
      line-height: normal;
    }

    .bespan span {
      display: block;
      color: #fff;
      font-size: 16px;
      cursor: pointer;
      line-height: 1;
    }

    .rules-apk a span b {
      margin-right: 4px;
    }

    .bespan span:last-child {
      text-decoration: underline;
    }

    .topright_drop .dropdown-toggle {
      color: #fff;
      font-size: 16px;
    }

    .topright_drop .dropdown-toggle::after {
      display: none;
    }

    .dropdown-menu-right a {
      font-size: 14px;
