    @keyframes newlaunch {
      0% {
        -webkit-transform: scale(1);
        transform: scale(1);
        color: #ffff00;
      }

      50% {
        -webkit-transform: scale(1.2);
        transform: scale(1.2);
        color: #ff0000;
      }

      100% {
        -webkit-transform: scale(1);
        transform: scale(1);
        color: #ffff00;
      }
    }

    @-moz-keyframes newlaunch {
      0% {
        -webkit-transform: scale(1);
        transform: scale(1);
        color: #ffff00;
      }

      50% {
        -webkit-transform: scale(1.2);
        transform: scale(1.2);
        color: #ff0000;
      }

      100% {
        -webkit-transform: scale(1);
        transform: scale(1);
        color: #ffff00;
      }
    }

    @-webkit-keyframes newlaunch {
      0% {
        -webkit-transform: scale(1);
        transform: scale(1);
        color: #ffff00;
      }

      50% {
        -webkit-transform: scale(1.2);
        transform: scale(1.2);
        color: #ff0000;
      }

      100% {
        -webkit-transform: scale(1);
        transform: scale(1);
        color: #ffff00;
      }
    }

    @-webkit-keyframes newlaunch-1 {
      0% {
        -webkit-transform: scale(1);
        transform: scale(1);
        color: #ff0000;
      }

      50% {
        -webkit-transform: scale(1.2);
        transform: scale(1.2);
        color: #0dd65a;
      }

      100% {
        -webkit-transform: scale(1);
        transform: scale(1);
        color: #ff0000;
      }
    }

